import React from 'react';
import { Layout, Menu, Table, Switch, Button } from 'antd';
import {
    HomeOutlined,
    MailOutlined,
    OrderedListOutlined,
    ShopOutlined,
    SettingOutlined,
    UserOutlined,
} from '@ant-design/icons';
import './AdminPage.css';

const { Header, Sider, Content } = Layout;
const { SubMenu } = Menu;

const columns = [
    {
        title: '编号',
        dataIndex: 'key',
        key: 'key',
    },
    {
        title: '菜单名称',
        dataIndex: 'name',
        key: 'name',
    },
    {
        title: '菜单级数',
        dataIndex: 'level',
        key: 'level',
    },
    {
        title: '前端名称',
        dataIndex: 'frontendName',
        key: 'frontendName',
    },
    {
        title: '前端图标',
        dataIndex: 'icon',
        key: 'icon',
    },
    {
        title: '是否显示',
        dataIndex: 'visible',
        key: 'visible',
        render: (text, record) => (
            <Switch checked={record.visible} />
        ),
    },
    {
        title: '排序',
        dataIndex: 'order',
        key: 'order',
    },
    {
        title: '设置',
        dataIndex: 'settings',
        key: 'settings',
        render: (text, record) => (
            <Button type="link">查看下级</Button>
        ),
    },
    {
        title: '操作',
        key: 'action',
        render: (text, record) => (
            <span>
        <Button type="link">编辑</Button>
        <Button type="link">删除</Button>
      </span>
        ),
    },
];

const data = [
    {
        key: '1',
        name: '商品',
        level: '一级',
        frontendName: 'pms',
        icon: <ShopOutlined />,
        visible: true,
        order: 0,
    },
    {
        key: '2',
        name: '订单',
        level: '一级',
        frontendName: 'oms',
        icon: <OrderedListOutlined />,
        visible: true,
        order: 0,
    },
    {
        key: '3',
        name: '营销',
        level: '一级',
        frontendName: 'sms',
        icon: <MailOutlined />,
        visible: true,
        order: 0,
    },
    {
        key: '4',
        name: '权限',
        level: '一级',
        frontendName: 'ums',
        icon: <SettingOutlined />,
        visible: true,
        order: 0,
    },
];

const AdminPage = () => {
    return (
        <Layout style={{ minHeight: '100vh' }}>
            <Sider>
                <div className="logo">管理系统</div>
                <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']}>
                    <Menu.Item key="1" icon={<HomeOutlined />}>
                        首页
                    </Menu.Item>
                    <SubMenu key="sub1" icon={<MailOutlined />} title="商品">
                        <Menu.Item key="2">商品列表</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub2" icon={<OrderedListOutlined />} title="订单">
                        <Menu.Item key="3">订单列表</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub3" icon={<ShopOutlined />} title="营销">
                        <Menu.Item key="4">营销活动</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub4" icon={<SettingOutlined />} title="权限">
                        <Menu.Item key="5">用户列表</Menu.Item>
                        <Menu.Item key="6">角色列表</Menu.Item>
                        <Menu.Item key="7">菜单列表</Menu.Item>
                        <Menu.Item key="8">资源列表</Menu.Item>
                    </SubMenu>
                </Menu>
            </Sider>
            <Layout>
                <Header className="site-layout-background" style={{ padding: 0 }} />
                <Content style={{ margin: '0 16px' }}>
                    <div className="site-layout-background" style={{ padding: 24, minHeight: 360 }}>
                        <Table columns={columns} dataSource={data} />
                    </div>
                </Content>
            </Layout>
        </Layout>
    );
};

export default AdminPage;
